// App.js
import React from 'react';
import { Provider } from 'react-redux';
import GoogleLogin from './GoogleLogin';
import store from './store';

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <GoogleLogin />
      </div>
    </Provider>
  );
}

export default App;
